//OBSERVER

const ShopActionTypes = {
   FETCH_COLLECTIONS_START: 'FETCH_COLLECTIONS_START',     //azione per il recupero dei dati asincroni
   FETCH_COLLECTIONS_SUCCESS: 'FETCH_COLLECTIONS_SUCCESS', //chiamata per avvenuto recupero delle collezioni
   FETCH_COLLECTIONS_FAILURE: 'FETCH_COLLECTIONS_FAILURE', //errore nel recupero delle raccolte
};

export default ShopActionTypes;
